import http from "./http-common";

class UserDataService {
  getAll() {
    return http.get("/users");
  }

  get(id) {
    return http.get(`/users/${id}`);
  }

  create(data) {
    return http.post("/users", data);
  }

  login(data) {
    return http.post("/users/login", data);
  }

  getLoans(id) {
    return http.get(`/users/loans/${id}`);
